const PARAGRAPHS = TEXT
  .split('\n')
  .filter(Boolean);

function setUpContextMenu() {
  const parentId = chrome.contextMenus.create({title: 'Lorem ipsum...', contexts: ['editable']});

  [
    1,
    2,
    5,
    10,
    20,
    50,
    100,
  ].forEach((numberOfParagraphs) => {
    let paragraphCopy = 'paragraph';
    if (numberOfParagraphs !== 1) paragraphCopy += 's';
    chrome.contextMenus.create({
      title: [numberOfParagraphs, paragraphCopy].join(' '),
      parentId,
      contexts: ['editable'],
      onclick: () => insertParagraphs(numberOfParagraphs),
    })
  });
}

function insertParagraphs(numberOfParagraphs) {
  const text = PARAGRAPHS
    .slice(0, numberOfParagraphs)
    .join('\n');

  chrome.tabs.getSelected(null, ({id}) => {
    chrome.tabs.sendMessage(id, {type: 'insertText', text});
  });
}
